/** @jsxRuntime classic */
/** @jsx jsx */
import { jsx, Image } from 'theme-ui';
import { Link } from 'components/link';
import Logopath from 'assets/logo-path.png'

export default function Logo({ src, ...rest }) {
  return (
    <Link
      path="/"
      sx={{
        variant: 'links.logo',
        display: 'flex',
        cursor: 'pointer',
        mr: 15,
      }}
      {...rest}
    >
      {/* <h1>Path.ti</h1> */}
      <Image
        width="150"
        height="100"
        src={Logopath}
        alt="startup landing logo"
      />
    </Link>
  );
}
